import React from "react";
import { logout } from "../actions/currentAccount";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import Sidenav from "./Sidenav";
const Navbar = (props) => {
  const logoutRedirect = () => {
    props.logout();
  };

  const render = () => {
    if (props.loggedIn && props.currentAccount.account.action) {
      const { id } = props.currentAccount.account.action;
      return (
        <>
          <Link to="/" className="brand-logo left">
            FoodTrucks
          </Link>
          <ul id="navbar" className="right 	">
            <li>
              <Link to={`/accounts/${id}/foodtrucks/lookup`}>
                Lookup a New truck
              </Link>
            </li>
            <li>
              <Link to={`/accounts/${id}/foodtrucks/new`}>
                Insert New truck
              </Link>
            </li>
            <li>
              <Link to={`/accounts/${id}`}>My Foodtrucks</Link>
            </li>
            <li onClick={logoutRedirect}>
              <Link to="/logout">Log out</Link>
            </li>
          </ul>
        </>
      );
    } else {
      return (
        <>
          <div>
            <div className="nav-wrapper ">
              <Link to="/" className="brand-logo left">
                FoodTrucks
              </Link>
              <ul id="nav-mobile" className="right center-on-med-and-down">
                <li>
                  <Link to="/signup">Sign Up</Link>
                </li>
                <li>
                  <Link to="/login">Login</Link>
                </li>
              </ul>
            </div>
          </div>
        </>
      );
    }
  };
  return (
    <div>
      <nav>
        {render()}
        {/* <div className="right show-on-small">
          <Sidenav />
        </div> */}
      </nav>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    currentAccount: state.currentAccount,
    loggedIn: !!state.currentAccount,
  };
};
export default connect(mapStateToProps, { logout })(Navbar);
